import React, { useState } from "react";
import api from "../api";
import { useNavigate } from "react-router-dom";
import "./LoginRegister.css"; // import the CodePen CSS here

export default function LoginRegister({ onLogin }) {
  const [isSignUp, setIsSignUp] = useState(false);
  const [username, setUsername] = useState("");
  const [password, setPassword] = useState("");
  const [registerUser, setRegisterUser] = useState("");
  const [registerPass, setRegisterPass] = useState("");
  const nav = useNavigate();

  async function handleLogin(e) {
    e.preventDefault();
    try {
      const res = await api.post(
        `/users/login?username=${encodeURIComponent(username)}&password=${encodeURIComponent(password)}`
      );
      const user = res.data;
      localStorage.setItem("user", JSON.stringify(user));
      if (onLogin) onLogin(user);
      nav("/dashboard");
    } catch (err) {
      alert("Login failed: " + (err?.response?.data || err.message));
    }
  }

  async function handleRegister(e) {
    e.preventDefault();
    try {
      await api.post("/users/register", {
        username: registerUser,
        password: registerPass
      });
      alert("Registered successfully! You can now sign in.");
      setIsSignUp(false);
    } catch (err) {
      alert("Register failed: " + (err?.response?.data || err.message));
    }
  }

  return (
    <div className={`container ${isSignUp ? "right-panel-active" : ""}`} id="container">
      {/* Sign Up */}
      <div className="form-container sign-up-container">
        <form onSubmit={handleRegister}>
          <h1>Create Account</h1>
          <span>Use your username & password</span>
          <input
            type="text"
            placeholder="Username"
            value={registerUser}
            onChange={(e) => setRegisterUser(e.target.value)}
          />
          <input
            type="password"
            placeholder="Password"
            value={registerPass}
            onChange={(e) => setRegisterPass(e.target.value)}
          />
          <button type="submit">Sign Up</button>
        </form>
      </div>

      {/* Sign In */}
      <div className="form-container sign-in-container">
        <form onSubmit={handleLogin}>
          <h1>Sign in</h1>
          <span>Use your account</span>
          <input
            type="text"
            placeholder="Username"
            value={username}
            onChange={(e) => setUsername(e.target.value)}
          />
          <input
            type="password"
            placeholder="Password"
            value={password}
            onChange={(e) => setPassword(e.target.value)}
          />
          <button type="submit">Sign In</button>
        </form>
      </div>

      {/* Overlay */}
      <div className="overlay-container">
        <div className="overlay">
          <div className="overlay-panel overlay-left">
            <h1>Welcome Back!</h1>
            <p>To keep connected, please login with your info</p>
            <button className="ghost" onClick={() => setIsSignUp(false)}>Sign In</button>
          </div>
          <div className="overlay-panel overlay-right">
            <h1>Hello, Friend!</h1>
            <p>Enter your details and start your journey</p>
            <button className="ghost" onClick={() => setIsSignUp(true)}>Sign Up</button>
          </div>
        </div>
      </div>
    </div>
  );
}
